  const todos = useSelector(state => state);

  return (
    <div className="App">
      <ToDoForm />
      <div className="todo-list">
        {todos.map((todo, index) => (
          <Todo
            key={index}
            todo={todo}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
